private static final JsonObject KNOWN_JSON = JsonFactory.newObjectBuilder()
            .set(ConnectionTag.JsonFields.ID, CONNECTION_ID.toString())
            .set(ConnectionTag.JsonFields.REVISION, REVISION)
            .build();

