@Test
    public void toJsonReturnsExpected() {
        final ConnectionTag underTest = ConnectionTag.of(CONNECTION_ID, REVISION);
        final JsonValue jsonValue = underTest.toJson();

        assertThat(jsonValue).isEqualTo(KNOWN_JSON);
    }

